Plot of &quot;The Gold Medal&quot; -
During the investigation of the political murder of labour leader Acharya (Dharmendra), Mr.David, the chief of Secret Services comes to know about the existence of a dangerous gang working against the interest of the Country. He deputes a promising young officer of his department Gopal (Jeetendra) to enquire into the activities of the gang and establish the indentity of its leader. While Gopal sets out to take down the gang, he falls victim to thir vicious plot. Gopal is accused of the murder of Bindu, the dancer at Eagle night club and thus has to go underground to save himself from the police. But, Gopal uses this oppurtunity to get inside the gang as a trusted member and unmask the criminal mastermind. Entangled in a web of deceit and double cross, can Gopal expose the leader of the Gang and save the country?

